var temp_id=0;
// глобальная переменная для путя
var path_func_array=new Array();
// глобальная переменная для списка
var func_array=new Array();
// глобальная переменная для текста информации о функции
var func_info="";

// функция по массиву строк делает вид для окошка выбока функции
function make_functions_array( func_array)
{
	var string="<ul>";
	for( var i=0; i<func_array.length; i++ )
	{
		string+= "<li id=\""+ 
						func_array[ i][ 1]+ "\" onclick=\"click("+
						func_array[ i][ 1]+ ","+ i+ ");\" >"+
						func_array[ i][ 2]+
				 "</li>";
	}
	string+= "<ul>";
	return string;
}
// найти в массиве x элемент
// с заданным родительским id
function get_with_perent_id(x,id)
{
	var tmp=new Array();
	for( var i=0; i< x.length; i++)
	{
		if( x[ i][ 0]== id)
		{
			var tt= new Array();
			tt.push( x[ i][ 0]);
			tt.push( x[ i][ 1]);
			tt.push( x[ i][ 2]);
			tt.push( x[ i][ 3]);
			tmp.push( tt);
		}
	}
	return tmp;
}
function get_with_perent_id_x(mx,id)
{
	var array=mx[id];
	if( array == null)
	{
		return []; 	
	}
	var tmp=new Array();
	for( var i=0; i< array.length; i++)
	{
		var a=new Array();
		a.push(id);
		a.push(array[i][0]);
		a.push(array[i][1]);
		a.push(array[i][2]);
		tmp.push(a);
	}
	return tmp;
}
// отрисовывает путь функций
function draw_path()
{
// отрисовываем сам путь
	var str= make_func_path( path_func_array);
	var func_path= document.getElementById( "functions_path");
	func_path.innerHTML= str;
}
// отрисовать список функций
function draw_func_list()
{
	var a= document.getElementById( "functions");
	var str= make_functions_array( func_array);
	a.innerHTML= str;
}
// по нажатии на функцию в списке функций
// она должна добавится в список функций путя
// должен обнавиться список функций
function click( id, i)
{
	//alert( "id="+id+" i="+i);
// добавляем новый эллемент в путь
	var g= new Array();
	g.push( func_array[ i][ 0]);
	g.push( func_array[ i][ 1]);
	g.push( func_array[ i][ 2]);
	g.push( func_array[ i][ 3]);
	path_func_array.push( g);
// отрисовываем сам путь
	draw_path();
// находим функции для списка
	func_array= get_with_perent_id_x( mx, id);
// перерисовываем список функций
	draw_func_list();
	//alert( g);
// в поле для информации о функции вставляем текст.
	func_info= g[ 3];
	draw_func_info();
}
// функция делает по массиву путь из функций
// n - массив для пути функций.
function make_func_path( n)
{
	var string= "<a onclick=\"click_path(0,-1) \" >::</a>";
	for( var i= 0; i< n.length; i++)
	{
		string+= "<a onclick=\"click_path("+ n[ i][ 1]+ ","+ i+ ");\">"+ n[ i][ 2]+ "</a>";
		if( (i+ 1)< n.length) string+= "=>";
	}
	return string;
}
// Был нажат i -ый элемент в списке
// Нужно удалить все элементы после i-ого элемента в списки пути
